package org.brainteam.lunchbox.json;public class JsonOrdersMonthlyOrderItem {	private JsonOfferItemInfo offerItem;	private Integer times;	private Long priceInCents;		public JsonOfferItemInfo getOfferItem() {		return offerItem;	}		public void setOfferItem(JsonOfferItemInfo offerItem) {		this.offerItem = offerItem;	}		public Integer getTimes() {		return times;	}		public void setTimes(Integer times) {		this.times = times;	}		public Long getPriceInCents() {		return priceInCents;	}		public void setPriceInCents(Long priceInCents) {		this.priceInCents = priceInCents;	}	}